import React from 'react';

import './Header.css';

const Header = () => {
  function myFunction() {
    let x = document.getElementById("nav_menu");
    if (x.style.display === "block") {
      x.style.display = "none";
    } else {
      x.style.display = "block";
    }
  }
  // let x = ("nav_menu");
  // if (x.style.display === "block") {
  //   x.style.display = "none";
  // } else {
  //   x.style.display = "block";
  // }
  return (
    <header id="header">
      <div className="container">
        <div className="header__section">
          <div className="header__logo">
            <div className="logo__plate">
              <div className="logo__plate_row">
                <div className="item_first_row" />
                <div className="item_first_row" />
                <div className="item_first_row" />
              </div>
              <div className="logo__plate_row">
                <div className="item_second_row" />
                <div className="item_second_row" />
                <div className="item_second_row" />
              </div>
              <div className="logo__plate_row">
                <div className="item_third_row" />
                <div className="item_third_row" />
                <div className="item_third_row" />
              </div>
            </div>
            <div className="logo_name">
              Paw-Luk Energy
        </div>
          </div>
          <nav className="header__nav_menu">
            <ul id="nav_menu" className="nav_menu">
              <li className="menu__item">
                <a href="#">OFERTA</a>
              </li>
              <li className="menu__item">
                <a href="#">O NAS</a>
              </li>
              <li className="menu__item">
                <a href="#">REALIZACJE</a>
              </li>
              <li className="menu__item">
                <a href="#">KONTAKT</a>
              </li>
            </ul>
            <button className="icon" onClick={myFunction}>
              OOO
            </button>
            {/* <a className="icon" onClick={myFunction}></a> */}
          </nav>
          <a href="tel:+48505404374" className="header__phone">
            +48 505-404-374
          </a>
        </div>
        <div className="main__section">
          <div className="offer">
            <h1>Podążaj ku przyszłości</h1>
            <h2>Online - sklep płyt fotowoltanicznych da ci możliwość
            <br />uratować nature!</h2>
            <a href="" className="btn">Zamów</a>
          </div>
        </div>
      </div>
    </header>
  );
};

export default Header;
